def minimum_time_for_complete_meal(N, K, categories, times):
    category_min_time = {}
    for i in range(N):
        category = categories[i]
        time = times[i]
        if category not in category_min_time:
            category_min_time[category] = time
        else:
            category_min_time[category] = min(time, category_min_time[category])
    if len(category_min_time) <= K:
        return -1
    min_times = list(category_min_time.values())
    min_times.sort()
    min_time_sum = sum(min_times[:K])
    return min_time_sum

